export const GCU_COLOR = {
  darkPurple: "#440b66",
  purple: "#5625a0",
  lightPurple: "#532496",
  extraLightPurple: "#e5deee",
  white: "#ffffff",
  orange: "#fe6901",
};

export const PURPLE_GRADIENT = `linear-gradient(0.25turn,${GCU_COLOR.lightPurple}, ${GCU_COLOR.darkPurple})`;

export const GCU_ASSETS = {
  logo: "/gcu-logo.svg",
};
